“Big man, pig man
Ha, ha, charade you are.”
- Pink Floyd

Giant Pig on the roof of Kane County Landscape Materials and Supply in Elburn, Illinois. Spraypaint. I only mapped out the outlines. The owner had his guys spray in the pink. The date escapes me, maybe 2011?

I painted this for Bruce, and at the  time he talked of possibly putting a larger one on the backside of the building so planes could see it. Didn’t happen. I remember asking him, why a giant pink pig? He responded by telling me it is instantly recognizable, and it makes it easy for people to find his place. “It’s the one with the giant pink pig on the roof!” Now that is marketing gold.

Thanks again, Bruce! Mapping out the proportions was an interesting task. I remember many, many feet of sharpie marked, taped paper or posterboard, running down the hallway. It was so big that I had to do each side, one at a time. I then checked all the sides together outside to see if it would work or not. Ha! Good times. I used a magnet Bruce gave me as reference material, and to my knowledge (based on the company’s photo in the last picture) the pig is still there, though I see the logo has since changed. Now that was a unique and fun job. Happy Friday, all!";}i:134;a:1:{s:14:"comments_count";i:1;}i:135;a:1:{s:11:"likes_count";i:32;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvBtWGJd_F";}i:137;a:1:{s:5:"image";s:239:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118701358_4637985672879030_4848247812141907720_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=N3w7iMy_GQoAX_h5pnT&oh=b005a02ddcdba87d48179f72fcb0537c&oe=5F7AB9CA";}i:138;a:1:{s:4:"type";s:7:"sidecar";}i:139;a:1:{s:8:"owner_id";i:2978224593;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391136423581287878";}i:144;a:1:{s:10:"short_code";s:11:"CEvBeiRD4XG";}i:145;a:1:{s:12:"created_time";i:1599265695;}i:146;a:1:{s:7:"caption";s:405:"#Repost artist @exit_broke #HistoricArt
